(1, 1, 'Inquiry-based Learning', 'In this course, we will discuss what is Inquiry-based Learning (IbL), what are the steps to follow in IbL, what will be a teacher\'s role in IbL and how will you assess students in IbL.', 0.000, 400.000, 'Approved', NULL, NULL, NULL, 0, NULL, '2020-08-20 11:11:33', 'inquiry-based-learning-IhDGWbSNdh', 'inquiry-based.jpg'),
(2, 1, 'Game-based Learning', 'In this course, we will discuss what is Game-based Learning (GbL), how can a lesson be taught using GbL and how will you assess students in GbL.', 0.000, 400.000, 'Approved', NULL, NULL, NULL, 0, NULL, '2020-09-03 15:40:31', 'game-based-learning-wKZ1DSase1', 'game-based-learning.jpg'),
(3, 1, 'Problem-based Learning', 'In this course, we will discuss what is Problem-based Learning (PbL), what are the steps to follow in PbL, what will be a teacher\'s role in PbL and how will you assess students in PbL.', 0.000, 400.000, 'Approved', NULL, NULL, NULL, 0, NULL, '2020-09-03 15:41:15', 'problem-based-learning-O2Vk1SIHe3', 'problem-based-learning-1.jpg'),
