(5, 95, 'Psychological Development of Students', 'In this course we will talk about the importance of proper psychological development and share techniques to build empathy, self-confidence, resilience and grit within our students.', 0.000, 400.000, 'Approved', NULL, NULL, NULL, 0, '2020-05-18 12:36:33', '2020-09-03 12:14:16', 'psychological-development-of-students-YQg9yW', '95_image_0ed6fab7c6ee9d34874b7f4ace4cc11a.jpg'),
