(2, 1, 'https://player.vimeo.com/video/349166095?autoplay=1&loop=0&autopause=0', NULL, '2020-04-16 12:22:19', '1.2 Inquiry-based Learning (Ibl) - অনুসন্ধানভিত্তিক শিক্ষা', 1, 'এই ভিডিওতে অনুসন্ধানভিত্তিক শিক্ষা বলতে আসলে কি বুঝায় এবং এর যথাযথ ব্যাখ্যা সম্পর্কে বিস্তারিত আলোচনা হবে।'),
(3, 1, 'https://player.vimeo.com/video/349167035?autoplay=1&loop=0&autopause=0', NULL, '2020-04-16 12:22:43', '2.1 Structure Of Ibl - অনুসন্ধানভিত্তিক শিক্ষার কাঠামো বা ধাপ সমূহ', 3, 'এই ভিডিওতে পুরো কাঠামোটি সম্পর্কে ধারণা দেয়া হবে।'),
(4, 1, 'https://player.vimeo.com/video/349168300?autoplay=1&loop=0&autopause=0', NULL, '2020-04-16 13:01:04', '2.2 Step 1: Starting With Asking - প্রথম ধাপঃ প্রশ্ন দিয়ে শুরু করা', 4, 'এই ভিডিওতে আমরা কোন সমস্যা, টপিক বা অধ্যায় নিয়ে কাজ করতে চাচ্ছি সেটার উপর কীভাবে প্রশ্ন তৈরি করতে হবে তা নিয়ে আলোচনা হবে।'),
(13, 1, 'https://player.vimeo.com/video/349283479?autoplay=1&loop=0&autopause=0', NULL, '2020-04-16 13:01:36', '3.1 Step 2: Selecting A Line Of Inquiry And Investigate - দ্বিতীয় ধাপঃ তদন্তের পন্থা নির্বাচন এবং তদন্ত করা', 6, 'এই ভিডিওতে শিক্ষার্থীদের তৈরি করা বিভিন্ন প্রশ্ন অনুসারে কীভাবে একটি দিক নির্ধারণ করে অনুসন্ধান শুরু করা হবে সেটা তুলে ধরা হবে।'),
(14, 1, 'https://player.vimeo.com/video/349284124?autoplay=1&loop=0&autopause=0', NULL, '2020-04-16 13:02:04', '3.2 Step 3: Record And Report - তৃতীয় ধাপঃ তথ্য লিপিবদ্ধ করা ও প্রতিবেদন লেখা', 7, 'এই ভিডিওতে শিক্ষার্থীরা অনুসন্ধান করে পাওয়া তথ্য কীভাবে সুন্দর করে লিপিবদ্ধ করবে এবং প্রতিবেদন তৈরি করবে তা নিয়ে আলোচনা করা হবে।'),
(15, 1, 'https://player.vimeo.com/video/349284575?autoplay=1&loop=0&autopause=0', NULL, '2020-04-16 13:03:13', '4.1 Step 4: Analyze And Interpret - চতুর্থ ধাপঃ বিশ্লেষণ ও ব্যাখা করা', 9, 'এই ভিডিওতে শিক্ষার্থীরা কীভাবে তথ্যগুলোকে বিশ্লেষণ করবে সেটা তুলে ধরা হবে।'),
