(16, 95, 'We are looking for a Subject Matter Expert (SME) who has an in-depth understanding of the Bengali-medium  English curriculum for class 11 and 12 to write scripts for video lessons. You need to be able to make the English curriculum interesting and relevant for high school students by using your knowledge and creativity to enhance their learning process. You will join a content production team dedicated to creating a pioneering educational product that will help shape and drive the future of Bangladeshi education technology.', '2020-12-21 13:40:29', '2020-12-21 13:41:03', 'Subject Matter Expert (SME) - English', 'Dhaka, Bangladesh', '20,000/-', 'Active', 'Approved', 0, 'You’ll join at an exciting time where you can make a huge impact. The subject matter expert (English) role sits at  the heart of the knowledge team producing scripts and you will do the follo', 'Bachelor’s degree and/or a Masters in English', 'Minimum of 2 years of experience in the field of teaching (private or otherwise)', '▪ You have a deep understanding of SSC and HSC English \r\n▪ You have a strong portfolio to showcase which highlights your skills and experience; \r\n▪ You have a drive for results, pride in the ', 'N/A', 'N/A', 'Both', '2021-01-21', NULL, 1, 1, 0),
(17, 95, 'We are looking for a Curriculum Lead (English) who has an in-depth understanding of the Bengali-medium English curriculum for class 11 and 12 to design the curriculum, write scripts for video lessons and lead a team of subject matter experts. You need to be able to make the English curriculum interesting and relevant for high school students by using your knowledge and creativity to enhance their learning process. You will join a content production team dedicated to creating a pioneering educational product that will help shape and drive the future of Bangladeshi education technology.', '2020-12-21 14:08:09', '2020-12-21 14:08:56', 'Curriculum Lead - English', 'Dhaka, Bangladesh', '30,000 - 35,000/-', 'Active', 'Approved', 0, 'You’ll join at an exciting time where you can make a huge impact. The subject matter expert (English) role sits at  the heart of the knowledge team designing the HSC English curriculum, produ', 'Bachelor’s degree and/or a Masters in English', 'Minimum 2 years of experience in the of teaching (private or otherwise)', '▪ You have a deep understanding of SSC and HSC English \r\n▪ You have a strong portfolio to showcase which highlights your skills and experience; \r\n▪ You have a drive for results, pride in the ', 'N/A', 'N/A', 'Both', '2021-01-21', NULL, 1, 1, 0),
