(20, 1169, 'Do you LOVE to TEACH? As a teacher of IAM School of Life, you will have the opportunity to teach kids the most important lessons of life. You will be able to teach students how to overcome the challenges and obstacles they face in life, how to set and reach goals, how to develop emotional intelligence and foster great friendships and a lot more. The School of Life program is designed to transform the lives of thousands of kids with an exciting curriculum based on Social Emotional Learning and Positive Psychology. \r\n\r\nThis role is a Part time journey toward fulfilling that dream of raising a more resilient, confident, next generation. Moreover you will also have the amazing opportunity to learn Social Emotional Intelligence to better your own life & career.', '2021-05-03 13:22:31', '2021-05-03 14:05:50', 'Teacher for School of Life', 'Gulshan / Online', 'BDT 8,000 to BDT 40,000 per month', 'Active', 'Approved', 1, 'Description\r\n\r\nYou will be responsible for taking activity / story-telling / art & craft based online classes for kids aged 5-12 years, on a curriculum designed with a combination of Social E', 'Key Qualifications\r\n\r\nIf you have been a teacher of a renowned English Medium School (early/Junior sections) for more than 2 years then do apply\r\nIf you can take a lesson plan and from there,', 'https://www.iammotherly.com/careers/teacher-for-school-of-life', NULL, 'Benefits\r\n\r\nYou will be earning on a per-class basis and will be paid monthly depending on the number of classes you take in a month. With our exciting per class model you will earn a minimum', '25 - 40 years', 'Female', '2021-05-31', NULL, 2, 6, 0);
