(13, 20, 1179, NULL, '4.5.2021\r\nTo\r\nThe IAM School of life,\r\n\r\nSubject: Application for the post of teacher.\r\n\r\nRespected Sir,\r\nIn response to your advertisement published on the web site www.bdjobs.com, dated 4th May 2021 for the post of teacher. As a candidate, I would like to apply for the post that I have mentioned above. Indeed, I am very delighted and interested to serve your institution. I have the requisite qualification, experience and good communication skills. I have five years working experience as  teacher. If I am selected, I shall discharge my duties to our entire satisfaction. \r\n\r\n\r\n\r\nSincerely Your \r\nZahura Khatun', 'New', '2021-05-04 18:33:32', '2021-05-04 18:33:32'),
(14, 20, 1181, NULL, 'I describe myself as a learner, a teacher, reader, writer, an occasional public speaker and a traveler. A very multifaceted mind. \r\nI have been in leadership positions, for example, I was appointment as the Branch Secretary of the United International University Student Branch. I have been tutoring and mentoring in education since the age of 17. And I believe I have the idea for a start up that can change the face of education in a developing country like Bangladesh.\r\n\r\nI was a top-scoring National Finalist for FameLab Bangladesh 2019. FameLab is a science communication competition and I was selected among 600+ applicants. The Masterclass with Mr. Malcolm Love added to my palate of public speaking. \r\n\r\nAfter this my life was catapulted into a very different one in which I became associated with the British Council and the British High Commission in Bangladesh. This also played a role into my my Department at University appointing me as their Branch Secretary, with me having no prior experience or insight into the role and I am still serving. I was extremely proud of all of the above.', 'Shortlisted', '2021-05-04 18:39:42', '2021-05-05 13:55:44'),
(15, 20, 236, NULL, 'Respected Sir/Madam,\r\nI am writing to apply for the position of Teacher at IAM SCHOOL OF LIFE. I have completed my Masters of Business Administration in Human Resources Management from Independent University, Bangladesh. I have worked as the homeroom teacher of Kindergarten at the well-known “American Standard International School” located in Dhaka, Gulshan-2 since 2017 till 2020. I have always had a passion for teaching thus after completing my studies I focused on building a career in this respected profession. Since I have been working as a teacher for almost 4 years I feel, I would be well suited for the position. Being an English medium student and having current knowledge of the curriculum gives me more hope that I can be a part of your reputed School. As per my academics credentials I have honorary mention on Dean’s list and Dean’s Honor list for educational excellence along with being the Cum Laude of Marketing department during my Bachelors of Business Administration completion, This could help and motivate many students to obtain their goals and achieve their dreams. Some key strength you may find relevant include:\r\n•	Ability to handle and understand the requirement of the children as I myself have a 7-year-old son\r\n•	Demonstrated ability to coordinate courseware and curriculum\r\n•	Special talent for maintaining discipline during instructional activities in the classroom as well as online.\r\n•	Hands-on experience in evaluating student performance\r\n•	Adept at managing the disruptive behavior of students and enforcing discipline\r\n•	Competent at evaluating the progress and performance of the students\r\n•	Maintain a friendly and happy environment along with discipline.\r\n•	Firsthand experience in handling students and parents from at least 8 different countries.\r\n•	In all my past batches of Kindergarten I always had specially-abled children who have enhanced my abilities as a teacher in so many different ways. I consider myself privileged that I got the opportunity to work with such wonderful kids.\r\n•	During this pandemic I have also conducted online classes for the last  1 year, thus I am very familiar with how to take online classes effectively and efficiently.\r\nFinally, my interest in becoming a teacher stems not just from my commitment to quality education but also from my desire to enrich the lives of my students. As a mother of a wonderful son, I have been passionate in my commitment to three things: maximizing individual student performance, inspiring students’ interest in studies and extra-curricular activities, and instilling a sense of self-worth among all students. In short, my mission is to impart my passion for teaching to students in such a way that it contributes to the entire community.  As an individual with a keen love for education, I firmly believe that I have what it takes to develop and implement tutoring plans that best fit each individual student’s academic needs. I can work comfortably with people from diverse backgrounds and can exhibit patience and judgment, especially where the need for both is desired. \r\nI look forward to learning more about this opportunity and discussing how I can contribute my strengths at your institution. I appreciate your taking the time to review my credentials and experience.\r\n\r\nSincerely,\r\nNoshin Shakura Sarnee', 'Shortlisted', '2021-05-04 18:52:30', '2021-05-05 13:52:24'),
(16, 20, 1185, NULL, 'Hello assalamuwalikum, I am Tahmina Haque currently  studying BBA in North South University. (Major Hrm and Mis).  I have completed  my Hsc from Dhaka Commerce College( GPA 5.00) and Ssc from Motijheel Ideal school and college( Gpa 5.00).\r\n  I am pretty  much interested to join as a teacher in this platform.', 'New', '2021-05-04 22:33:15', '2021-05-04 22:33:15'),
(17, 20, 1187, NULL, 'dear sir\r\nwith due respect,i am tanjina tahrin.i have completed my post graduation from home economics college in child development and social relation subject.i also teach a daycare center as a pre school teacher.i am very dedicated to my profession and love the little children so much.i am very interested to work with alokito teacher.', 'New', '2021-05-05 04:45:49', '2021-05-05 04:45:49'),
(18, 20, 1193, NULL, 'RAISA MEHZABEEN\r\n\r\nraisameh20@gmail.com\r\n\r\nMay 5, 2021\r\n\r\nDear Hiring Manager,\r\n\r\nI am excited to be applying for a teaching position at Alokito teacher. As someone who loves education, possesses excellent organizational skills and can connect easily with students, this is the perfect opportunity for me to continue my professional development. I believe that my experience and passion for teaching would be the ideal fit for your institution, and I am thrilled at the opportunity to join your team.\r\n\r\nI have been a online and offline teacher for the past 5 years in various capacities and grade levels. In each class that I have taught, 100% of my students passed their exams and improved their scores comparatively.\r\n\r\nI enjoy the challenge of teaching students academically but also helping them to thrive socially. As a team player, I have joined and participated in committees and projects to help build a new significance.\r\n\r\nThank you for considering me for this position. I look forward to meeting you in person and sharing with you my teaching about mental health,and biology while learning more about this job opportunity. I am a committed lifelong learner and I will continue to grow as a teacher and in my knowledge of subject matter throughout my time at your school.\r\n\r\nSincerely,\r\n Raisa Mehzabeen', 'New', '2021-05-05 11:55:46', '2021-05-05 11:55:46'),
(19, 20, 1195, NULL, 'Dear Concern,\r\nI have passed HSC exam very recently.I haven\'t much experience about teaching.But I love kids and love to spend time with them.Story telling is a very favorite section of mine.I can assure you I will do my job with full of dedication.I will be grateful if you give me a chance to face the interview.\r\n\r\n\r\nThanks & Regards.\r\n\r\nRespectfully \r\nJannatul Ferdous Sweet', 'New', '2021-05-05 12:58:33', '2021-05-05 12:58:33'),
