(21, 20, 1202, NULL, NULL, 'New', '2021-05-05 14:44:09', '2021-05-05 14:44:09'),
(22, 20, 1207, NULL, 'Dear sir/ ma\'am\r\n\r\nI am interested in applying for an elementary-level teaching position in your school district. As a undergraduate student , I have student teaching experience on the third- fourth-, and sixth-grade level,. I believe my teaching experience and passion for community engagement make me an ideal candidate for a teaching position at your school.\r\n\r\nI have experience teaching elementary-level students in a variety of settings. I am currently teaching third-grade children online . \r\n\r\nYour school also strives to engage students in the larger community. I have lots of experience incorporating community service projects into my classrooms. For example, as a student teacher, I led a unit for third-graders on plant life, and we volunteered at a local community garden. I would love to find ways to integrate service learning into my lesson plans.\r\n\r\nIt is my goal to combine my range of experience with my ability to be a compassionate, enthusiastic, intelligent teacher who will make a positive contribution to your school district and larger community. I would hope to hear from you at your earliest convenience.\r\n\r\nSincerely,\r\n\r\nMahera Zaman', 'New', '2021-05-05 15:06:15', '2021-05-05 15:06:15'),
(23, 20, 1209, NULL, 'I am Rifat Sharmin,  a graduate from University Of Dhaka in Home Economics. My graduation year was 2018. \r\nI am a quick learner with abilities of teamwork, attention to details and have proficiency in communication. Also i would like to mention that i have been giving tutions to students for the past 7 years. I believe that these qualities will help me to support your organization with my hard work.\r\n\r\nLooking forward to hearing from you soon.  \r\n\r\nKind regards,\r\nRifat Sharmin', 'New', '2021-05-05 15:16:41', '2021-05-05 15:16:41'),
(24, 20, 1211, NULL, 'Dear Concern, \r\nI am CSE graduate form BRAC University. I have completed my graduation just recently. My CGPA is 3.61/4.00.\r\nI completed mu SSC and HSC from Viqarunnisa Noon School and College and passed both of my SSC and HSC examination with 5.00/5.00 with a board scholarship in HSC. \r\nFrom the beginning of my under graduation life I am involved in teaching profession and a have an experience to teach students with care and effectively. \r\nMost of the students of mine were from Science background. \r\nI prefer teaching productively and effectively. \r\nTherefore, I believe I will be a best fit for the position.\r\nWith best Regards,\r\nBivasha Bashir Biva \r\nContact No : +8801942512284\r\nEmail : bivaruhy33@gmail.com', 'New', '2021-05-05 15:38:19', '2021-05-05 15:38:19'),
(25, 20, 1213, NULL, NULL, 'New', '2021-05-05 15:53:39', '2021-05-05 15:53:39'),
(26, 20, 1217, NULL, 'Greetings to the authority,\r\nIt is really a great opportunity for me to work here. Hope, I will get a chance to sit for an interview & prove myself to work agains this post.\r\nSincerely yours,\r\nShuravi Saha', 'New', '2021-05-05 16:20:43', '2021-05-05 16:20:43'),
(27, 20, 1224, NULL, 'I am an educator. I like to teach kids and I also enjoy some of my moments with them. I want to teach them about cooperation, leadership and stratagic way of learning.', 'New', '2021-05-05 17:19:45', '2021-05-05 17:19:45'),
(28, 20, 1198, NULL, 'Md. Zahirul Islam\r\n46/2, Blocak-A, Mojidpur\r\nSavar,Dhaka-1340\r\nCell: +880 1515609858\r\nEmail: zahir.islam.8011@gmail.com\r\n\r\n5th May 2021\r\n\r\nHiring Manager,\r\nAlokito Teachers\r\n3/11, Block B, Lalmatia\r\nDhaka 1207, Bangladesh \r\n\r\nDear Madam / Sir,\r\n\r\nEver since I started my job as a Fellow at Teach For Bangladesh, I have been passionate about my commitment to the tasks like teaching, leading, and mentoring to make out the best of students for ensuring quality education. I have always been looking for new challenges in my career as an opportunity to learn, grow, and change.\r\n\r\nThat\'s why I was excited to see the advertisement in your online portal for Teacher for School of Life in your renowned organization. Alokito Teachers has earned a notable reputation and excellence through ensuring 21st century education for future leaders. It would be an honor and privilege to contribute to the achievement of the goals of this organization.\r\n\r\nMy qualifications include BBA and MBA in Accounting & Information System, a nearly completed M.Ed in Educational Leadership and School Improvement, a Fellowship for 2.2 years, and a Coach role for 1.3 years from Teach For Bangladesh.\r\n\r\nI have ended my recent Coach role from Teach For Bangladesh on 25th March 2021. As a Coach, I successfully transformed nineteen young Fellows\' leadership qualities in ensuring equitable quality education for the underserved primary students in Bangladesh. Previously, I worked as a Fellow in the same organization implementing inclusive and quality education, student leadership, and community coordination. I engaged significantly in voluntary work with youth leaders throughout my university life advocating and campaigning for environmental and sustainable development.\r\n \r\nAs an enthusiastic leader, I developed a student leadership development model in 2019 for students in order to establish the voice of students in society. More than 2,000+ students, community people, and teaches are still being impacted through the implementation of this model. This leadership development model helped students to exercise their leadership qualities through building a strong partnership with peers, teachers, and community people. \r\n \r\nIn light of my previous academic and professional experiences, I find the position in Alokito Teachers most suitable for me as it will ensure my continuous proactiveness, creativity, and presence in my expected career.\r\n\r\nThank you for your time and consideration. I look forward to hearing from you soon.\r\n\r\nRegards,\r\nMd. Zahirul Islam', 'New', '2021-05-05 17:38:24', '2021-05-05 17:38:24'),
(29, 20, 1229, NULL, 'Greetings,\r\nThis is Puja Saha. I have completed my graduation from BRAC University on English (Summer2020). At present I\'m doing my master from BRAC university on Teaching English to Students of Other Languages.  \r\nI\'m interested in this job as I always had the wish to share my experience, knowledge, learning in practical ground. \r\nI\'m also eager to work for the development of your respective institution. \r\nI therefore, hope that you would give an opportunity to be a part of your institution. Thank you.', 'New', '2021-05-05 17:48:38', '2021-05-05 17:48:38'),
(30, 20, 1231, NULL, NULL, 'New', '2021-05-05 17:50:36', '2021-05-05 17:50:36'),
(31, 20, 1240, NULL, 'Sir,\r\nIn response to your advertisement  through facebook I have come to know you are looking for someone who will inspire others about life. With due respect I would like to state that, I am a student of Jahangirnagar University, currently studying at department of Chemistry and I think I am able to do this kind of job.             \r\nI hope that you will consider me as a perfect candidate for this and give me an opportunity to prove myself.', 'New', '2021-05-05 20:02:25', '2021-05-05 20:02:25'),
(32, 20, 1241, NULL, NULL, 'New', '2021-05-05 20:05:14', '2021-05-05 20:05:14'),
(33, 20, 1250, NULL, 'Dear concern, \r\nI am writing to you regarding the job opportunities you have proposed. Not only I believe \r\nthat I am perfect for this position but also I have potential and dedication for this \r\nresponsibility.\r\n• I strive continually for excellence \r\n• know the value of social emotional learning\r\n• Good communication \r\n• Love to learn things & enjoy my work \r\n. working as an Officer In Charge, Admin, BlackBrains\r\n• Active in extra curriculum activities and\r\nParticipated in few business-case competition (finalist of HULT PRIZE 2019, campus round)\r\n\r\nI am an undergraduate student studying at Rajshahi University of Engineering & Technology(RUET), 5th semester ,completed my HSC & SSC from Viqarunnisa Noon School & College with a GPA of 5.00\r\n\r\nI have experience in working with Non-profit Organization and teaching students of class 4 to 12.  \r\n\r\nI can be reached any time via email at aysha1118vr@gmail.com or by cell phone, \r\n01790625337\r\nRespecting other candidates I would like to say that I am perfectly capable for this \r\nopportunity. My skills and strength can best serve your organization.\r\nSincerely,\r\nAysha Akter Monica\r\nEmail address: aysha1118vr@gmail.com', 'New', '2021-05-05 23:05:20', '2021-05-05 23:05:20'),
(34, 20, 1252, NULL, 'I have experience of teaching preschoolers for 3years.', 'New', '2021-05-05 23:55:49', '2021-05-05 23:55:49'),
(35, 20, 1256, NULL, 'I never believed in conventional study method. Always I have this constant feeling that you don\'t need to go through primary , secondary, higher secondary ...etc educational level to make yourself educated, what you need is the pure urge towards knowing the unknown and implying it in your real life. So I have  this ambition of setting the society and our new generation free from the typical education system and make them realize the real essence of education, knowledge and wisdom. I want to make education such amazing that everyone will be attracted by the beauty of that.', 'New', '2021-05-06 00:24:44', '2021-05-06 00:24:44'),
(36, 20, 1247, NULL, 'Dear Sir/ Madam,\r\nWith this letter and the attached resume, I would like to express my sincere interest in the position of Teacher of your organization. I am confident that I have the knowledge and ability that I can contribute myself toward the success of your organization.\r\nThe following achievements demonstrate my qualifications for this position:\r\nI have almost 9 years of full time teaching experience in a well-known school in Bangladesh. I have completed (Training on Abacus and mental arithmetic) from Aloha Bangladesh and joined there as part time teacher. I am also ‘Teacher Ambassador’ of ALOKITO Teachers (December 2020 to February 2021)  \r\nI have completed MBA and “Post Graduate Diploma” in Human Resource Management from United International University. I am enrolling myself in Pre-Primary and Primary Teachers’ Training Course recognised by NCTE (In Sunderji Teachers’ Training Institute) (On Going). I am also completed few workshops on pre-school and effective teaching for young child.\r\n\r\nI believe my relevant working experience and specialized training on ‘Abacus and mental arithmetic’, ‘Pre-Primary and Primary Teachers’ training will contribute immensely to the success of your organization.\r\nThank you for your kind consideration, and I look forward to speaking with you soon.\r\n\r\n\r\nSincerely,\r\nHafiza Hanif', 'New', '2021-05-06 01:34:39', '2021-05-06 01:34:39'),
(37, 20, 1249, NULL, 'Hello, I am Arifa Hossain Bristy. I study in Department of Computer Science and Engineering at University of Asia Pacific. I love teaching students a lot. I\'ve tutored many students in my life and I am quite confident and caring at teaching students. It would be my honor to join IAM Scholl of Life as a teacher.', 'New', '2021-05-06 01:35:58', '2021-05-06 01:35:58'),
(38, 20, 1267, NULL, 'Following your recent job recruitment procedure, I am pleased to submit herewith my CV for your kind  consideration. I would welcome any response to you. I am available anytime, and look forward very much to hearing from you.', 'New', '2021-05-06 04:11:07', '2021-05-06 04:11:07'),
(39, 20, 1271, NULL, 'I\'m a friendly person and i love children.and really love to spend time with them but the best  part is when they love me back,the sweetest moment ever isn\'t it?', 'New', '2021-05-06 05:32:44', '2021-05-06 05:32:44'),
(40, 20, 1272, NULL, 'Dear sir/ma’am,\r\n\r\nI am very interested in applying for a teaching position in your school. I would like to apply as a teacher at the Elementary level in your school. I have experienced teaching for class one to four grade levels. I hope I will continue my teaching career at your school.\r\n\r\nTeaching in elementary school is challenging for me. The elementary school gives basic skills to the students. I have worked as an English substitute teacher at Academia English Medium School in Gulshan campus, Dhaka. I applied the Essential Academic Learning Requirements concept in lesson planning and contributed to the Character Education curriculum. I have successfully developed a proactive classroom.\r\n\r\nI have completed my undergraduate in English Language and Linguistics from BRAC University. Currently, I am doing MA in TESOL which is also from BRAC University. I am capable of problem-solving in crucial cases. I am able to handle my students properly in the classroom. I am able to use interesting online teaching methods that make students focus on the lesson. I have strong leadership and organizational skills. I also have good computer skills as well.\r\n\r\nI hope that my skills and experience are suitable for your job requirements. I will be so happy if I get the opportunity to meet you for the further selection process.', 'New', '2021-05-06 05:43:27', '2021-05-06 05:43:27'),
(41, 20, 1275, NULL, 'Dear Hiring Manager,\r\n \r\nWith due respect to state that, having known your advertisement from the website, I beg to offer myself as a candidate for the position Teacher. I have good knowledge on overall  that may be of your interest.\r\n \r\nI am confident that I am a good candidate for the position you are requiring, so I would like it very much to have an opportunity to further discuss with you regarding your offer.\r\n \r\n \r\nSincerely yours,\r\nFarjana Akter Dipa\r\ndipa301192@gmail.com\r\nContact: +8801631105632', 'New', '2021-05-06 05:48:34', '2021-05-06 05:48:34'),
(42, 20, 1277, NULL, 'Dear Concern, \r\nI would like to apply for your mentioned position. I have completed \r\nBachelor and Masters in Human Resource Management from renowned private educational institutions. I have around 10 years working experience in Human Resource Department. In my last organisation, I was working as HR Manager.  Recently I have resigned from my current organisation due to distance as it was in Savar EPZ area. Therefore,  I want to restart my career in teaching profession and looking forward for your support. \r\nThanks and best regards, \r\nRomana Akter', 'New', '2021-05-06 08:10:41', '2021-05-06 08:10:41'),
(43, 20, 1282, NULL, NULL, 'New', '2021-05-06 10:24:30', '2021-05-06 10:24:30'),
(44, 20, 1283, NULL, 'Dear Sir/Ma\'am,\r\n\r\nWith due respect this is to inform you that I came across the recruitment post on facebook and I am highly interested in teaching. I have completed my B.A in English from East West University. I can assure you that with my previous experience as a home tutor of kids along with my academic knowledge I will be able to take the challenging role as a teacher in the institution. \r\n\r\nI would be grateful if you please consider me as a candidate for the vacant position.\r\n\r\nThanks and Regards,\r\nSabiha Hossain Hina', 'New', '2021-05-06 10:55:17', '2021-05-06 10:55:17'),
(45, 20, 1284, NULL, NULL, 'New', '2021-05-06 12:07:17', '2021-05-06 12:07:17'),
(46, 20, 1286, NULL, 'Dear employer\r\nI am Musrat Zahan Mimi from IBA, University of Rajshahi. I have completed my BBA program. Teaching is my passion and I am involved in this profession from very earlier time of my life.Now I am applying for this lucrative opportunity.\r\n\r\nSincerely\r\nMusrat Zahan Mimi', 'New', '2021-05-06 12:25:46', '2021-05-06 12:25:46');
